import "./subject.css"
const Subject = (props) => {
    const subjects = props.subject;
    return(
        <div className="subList" style = {{display:"flex",justifyContent:"spaceBetween", backgroundColor:"pink"}}>
     {subjects.map((sub, index) => (
                <div key={index} className="subName" style={{color:"#FFFF",display:"flex",justifyContent:"spaceBetween"}}>{sub}</div>
              ))}
        </div>
    )
}
export default Subject;
